    public void renderDynamic(float f5, float prog) {
        float move = prog > 500 ? 2 - (prog / 500f) : prog / 500f;
        GL11.glPushMatrix();
        GL11.glTranslatef(move * 0.0625f * 3, 0, 0);
        PistonHead1.render(f5);
        PistonArm1.render(f5);
        GL11.glTranslatef(-2 * move * 0.0625f * 3, 0, 0);
        PistonHead2.render(f5);
        PistonArm2.render(f5);
        GL11.glPopMatrix();
    }

    private void setRotation(ModelRenderer model, float x, float y, float z) {
        model.rotateAngleX = x;
        model.rotateAngleY = y;
        model.rotateAngleZ = z;
    }

